script: |
  super -f text -I q10209.spq | sort > q10209.out

inputs:
  - name: q10209.spq
    data: |
      SELECT - + col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN - 31 + + col2 * col0 * CAST ( 96 AS INTEGER ) AND + col2 * + col0;
  - name: tab0

outputs:
  - name: q10209.out
    data: |
